const Start = (props) => {
    return (
        <div>
                <h1>
                    캐릭터들로 보는<br/>나의 성격 유형 테스트
                </h1>
                <input
                    type="text"
                    style={{
                        padding: "7px",
                        margin: "20px 0px",
                        border: "1px solid #4374d9",
                        borderRadius: "20px",
                        width: "40%",
                        textAlign: "center",
                    }}
                    placeholder="내 이름"
                />
                <button
                    className="button"
                    // onClick={() => {
                    //     props.history.push("/quiz");
                    // }}
                >
                    시작하기
                </button>
        </div>
    );
};

export default Start;


